import { Pipe, PipeTransform } from '@angular/core';

@Pipe({
    name: 'checkDateValid',
})
export class CheckDateValidPipe implements PipeTransform {
    transform(value: any, args?: any): any {
        let today = new Date().setHours(0,0,0);
        let date = new Date(value).setHours(0,0,0);
        return today >= date ? 'Tidak Aktif':'Aktif';
    }
}

import { CurrencyPipe } from '@angular/common';
import { Pipe, PipeTransform } from '@angular/core';

@Pipe({
    name: 'curr',
})
export class CurrPipe extends CurrencyPipe implements PipeTransform {
    transform(value: any, args?: any): any {

        let result;
        result = super.transform(value, args);
    
    
        return result.replaceAll('.00','').replaceAll('$','').replaceAll(',','.');
      }
}

import { Pipe, PipeTransform } from '@angular/core';
import { DatePipe } from '@angular/common';

@Pipe({
    name: 'formatDate',
})
export class FormatDatePipe extends DatePipe implements PipeTransform {
    constructor() {
        super('en-US');
    }

    transform(value: any, haveTime?: any): any {
        let format = 'dd-MM-yyyy';
        if (haveTime) {
            format = 'dd-MM-yyyy HH:mm';
        }
        if (value && value != '-') {
            if (value instanceof Date) {
            } else {
                value = value.replaceAll('-', '/');
            }

            let b: any;
            if (value instanceof Date) {
                b = value;
            } else {
                b = new Date((value += haveTime ? ' GMT+0700' : ''));
            }
            if (b.getFullYear() === 9999) {
                return '-';
            } else {
                return super.transform(b, format);
            }
        } else {
            return '-';
        }
    }
}

import { Pipe, PipeTransform } from '@angular/core';
import { DatePipe } from '@angular/common';

@Pipe({
    name: 'formatDateTimeZone',
})
export class FormatDateTimeZonePipe extends DatePipe implements PipeTransform {
    constructor() {
        // super(authService.getSession().locale);
        super('en-US');
    }

    transform(value: any, haveTime?: any, dateDay?: any): any {
        let format = 'dd-MM-yyyy';
        if (haveTime) {
            format = 'dd-MM-yyyy HH:mm';
        }
        if (dateDay) {
            format = 'EEEE, dd LLLL yyyy HH:mm';
        }
        if (value && value != '-') {
            if (value instanceof Date) {
            } else {
                value = value.replaceAll('-', '/');
            }

            let b: any;
            if (value instanceof Date) {
                b = value;
            } else {
                b = new Date((value += haveTime ? ' GMT+0000' : ''));
            }
            if (b.getFullYear() === 9999) {
                return '-';
            } else {
                return super.transform(b, format);
            }
        } else {
            return '-';
        }
    }
}

import { Pipe, PipeTransform } from '@angular/core';
import { DatePipe } from '@angular/common';

@Pipe({
    name: 'formatTime',
})
export class FormatTimePipe extends DatePipe implements PipeTransform {
    constructor() {
        super('en-US');
    }

    transform(value: any): any {
        let formated = "-";
        if(value){
            let format="HH:mm";
            let date = new Date("2022/01/01 "+value+" GMT+0700");
            formated=super.transform(date,format)
        }
        return formated;
    }
}

import { Pipe, PipeTransform } from '@angular/core';

@Pipe({
    name: 'spaceToComma',
})
export class SpaceToCommaPipe implements PipeTransform {
    transform(value: any, args?: any): any {
        let data = value.split(' ').toString();
        if(data.charAt(data.length - 1)==","){
            data =data.substring(0, data.length - 1)
        }
        return data;
    }
}

