})
export class AttendanceDashboardComponent implements OnInit, OnDestroy {
    chartOptions;
    listOpt = [
        { label: 'Hari ini', value: 0 },
        { label: 'Minggu ini', value: 1 },
        { label: 'Bulan Ini', value: 4 },
    ];
    loading = true;
    constructor(
        private srv: DashboardService,
        private configService: ConfigService
    ) {
        this.chartOptions = {
            chart: {
                id: 'attendance-chart',
                height: 285,
                type: 'donut',
            },
            labels: [],
            tooltip: {
                enabled: true,
            },
            responsive: [
                {
                    breakpoint: 900,
                    options: {
                        chart: {
                            height: 400,
                        },
                        legend: {
                            position: 'bottom',
                        },
                    },
                },
            ],
            noData: {
                text: 'Empty Data',
                align: 'center',
                verticalAlign: 'middle',
                offsetX: -80,
                offsetY: -20,
                style: {
                    color: '#9f9f9f',
                    fontSize: '14px',
                },
            },
            series: [],
            plotOptions: {
                pie: {
                    donut: {
                        labels: {
                            show: true,
                            name: {
                                show: true,
                                fontSize: '18px',
                                fontFamily: 'SF Pro Text',
                                offsetY: -10,
                            },
                            value: {
                                show: true,
                                fontSize: '16px',
                                fontFamily: 'SF Pro Text',
                                offsetY: 16,
                                formatter: function (val) {
                                    return val;
                                },
                            },
                            total: {
                                show: true,
                                label: 'Total',
                                color: '#373d3f',
                                formatter: function (w) {
                                    return w.globals.seriesTotals.reduce(
                                        (a, b) => {
                                            return a + b;
                                        },
                                        0
                                    );
                                },
                            },
                        },
                    },
                },
            },
        };
    }

    onSelect(e) {
        this.getData(e);
    }

    subcription;
    ngOnInit(): void {
        this.getData(0);
        this.subcription = this.configService.menuToggle$.subscribe(
            (config) => {
                this.wait();
            }
        );
    }

    async wait() {
        await new Promise((f) => setTimeout(f, 200));
        this.reload();
    }

    getData(e) {
        this.loading = true;
        this.srv
            .getAttendance(e)
            .toPromise()
            .then((res) => {
                this.chartOptions.series = res.data;
                if (
                    this.chartOptions.series[0] == 0 &&
                    this.chartOptions.series[1] == 0
                ) {
                    this.chartOptions.series = [];
                }
                this.chartOptions.labels = res.labels;
                this.loading = false;
                this.reload();
            });
    }

    reload() {
        this.chartOptions.responsive = [
            {
                breakpoint: 480,
                options: {
                    legend: {
                        position: 'bottom',
                    },
                    noData: {
                        offsetX: 0,
                        offsetY: -50,
                    },
                    dataLabels: {
                        enabled: true,
                        style: {
                            fontSize: '10px',
                        },
                    },
                },
            },
        ];
        var chart = new ApexCharts(
            document.querySelector('#attendanceChart'),
            this.chartOptions
        );

        chart.render();
    }
    ngOnDestroy(): void {
        this.subcription.unsubscribe();
    }
}

