            [value]="item.value"
            [(ngModel)]="selected"
            (onChange)="onChange()"
            >
        </p-checkbox>
    </div>
    `,
    styleUrls: ['./checkbox.component.css']
})

export class CheckboxComponent{
    @Input() items: any[] = [
        {label : '1', value : '1'},
        {label : '2', value : '2'},
    ];
    @Input() isVertical : boolean = true;
    @Output() select = new EventEmitter<any>();
