import { Component, Input, OnInit, Output, EventEmitter } from '@angular/core';
import { MessageBoxService } from '../../service/message-box.service';

@Component({
    selector: 'app-linov-upload',
    templateUrl: './linov-upload.component.html',
    styleUrls: ['./linov-upload.component.scss'],
})
export class LinovUploadComponent implements OnInit {
    @Input() src;
    @Input() isImage;
    @Input() isImagePreview;
    @Output() onChange = new EventEmitter<any>();
    @Input() maxFileSize = 1048576;
    @Input() allowedFileType;
    @Input() fileType = 'image';
    extensionMap = new Map([
        ['excel', ['.XLSX', '.XLS']],
        ['image', ['.JPG', '.PNG', 'JPEG']],
        ['docs', ['.DOCX', '.DOC', '.PDF', '.XLSX', '.XLS']],
    ]);
    formatedFileType;
    formatedSize;
    file;
    uploadedFiles;

    constructor(private msg: MessageBoxService) {}

    ngOnInit(): void {
        if (!this.allowedFileType) {
            this.allowedFileType = this.extensionMap.get(this.fileType);
        }
        this.formatedSize = this.formatBytes(this.maxFileSize);
        this.formatedFileType = this.allowedFileType
            .toString()
            .split('.')
            .join('')
            .toUpperCase();
    }

    formatBytes(bytes) {
        var marker = 1024;
        var decimal = 0;
        var kiloBytes = marker;
        var megaBytes = marker * marker;
        var gigaBytes = marker * marker * marker;
        if (bytes >= gigaBytes)
            return (bytes / gigaBytes).toFixed(decimal) + ' GB';
        else if (bytes >= megaBytes)
            return (bytes / megaBytes).toFixed(decimal) + ' MB';
        else if (bytes >= kiloBytes)
            return (bytes / kiloBytes).toFixed(decimal) + ' KB';
        else return bytes + ' Bytes';
    }

    click(e) {
        this.onChange.emit(e);
    }
    clear() {
        this.uploadedFiles = null;
        this.file = null;
        this.src = null;
        this.onChange.emit(null);
    }
    onUpload(event) {
        this.uploadedFiles = event.target.files.item(0);
        let extArray = this.uploadedFiles.name.split('.');
        let ext = extArray[extArray.length - 1];
        if (this.uploadedFiles.size > 1000000) {
            this.msg.showError('Ukuran gambar terlalu besar');
        } else if (
            !this.formatedFileType.toLowerCase().includes(ext.toLowerCase())
        ) {
            this.msg.showError(
                'File yang di perbolehkan hanya: ' + this.formatedFileType
            );
        } else {
            const reader = new FileReader();
            reader.readAsDataURL(this.uploadedFiles);
            reader.onload = () => {
                this.src = reader.result as string;
            };
            this.onChange.emit(this.uploadedFiles);
        }
    }
}

