import {
    ChangeDetectionStrategy,
    ChangeDetectorRef,
    Component,
    OnInit,
} from '@angular/core';
import {
    UntypedFormBuilder,
    UntypedFormGroup,
    Validators,
} from '@angular/forms';
import { ApiService } from 'src/app/core/service/api.service';
import * as CryptoJS from 'crypto-js';
import { AuthenticationService } from 'src/app/core/service/authentication.service';
import { Router } from '@angular/router';
import { HttpClient } from '@angular/common/http';
import { ActivatedRoute } from '@angular/router';
import { firstValueFrom, lastValueFrom } from 'rxjs';

export function encryptionPassword(formValue) {
    var encryptedBase64Key = 'bXVzdGJlMTZieXRlc2tleQ==';
    var plaintText = formValue;
    var parsedBase64Key = CryptoJS.enc.Base64.parse(encryptedBase64Key);
    var encryptedData = CryptoJS.AES.encrypt(plaintText, parsedBase64Key, {
        mode: CryptoJS.mode.ECB,
        padding: CryptoJS.pad.Pkcs7,
    });
    let encPassword = encryptedData.toString();
    return encPassword;
}
@Component({
    selector: 'app-login',
    templateUrl: './login.component.html',
    styleUrls: ['./login.component.scss'],
    changeDetection: ChangeDetectionStrategy.OnPush,
})
export class LoginComponent implements OnInit {
    model = {
        username: '',
        password: '',
    };
    token;
    password;
    formControl: UntypedFormGroup;
    isLoading = false;
    images: any[];
    responsiveOptions: any[] = [
        {
            breakpoint: '1024px',
            numVisible: 5,
        },
        {
            breakpoint: '768px',
            numVisible: 3,
        },
        {
            breakpoint: '560px',
            numVisible: 1,
        },
    ];
    constructor(
        private srv: ApiService,
        private formBuilder: UntypedFormBuilder,
        private auth: AuthenticationService,
        private route: Router,
        private router: ActivatedRoute,
        private http: HttpClient,
        private cd: ChangeDetectorRef
    ) {
        this.createForm();
    }

    createForm() {
        this.formControl = this.formBuilder.group({
            username: ['', Validators.required],
            password: ['', Validators.required],
        });
    }
    ngOnInit(): void {
        this.getImages().then((images) => {
            this.images = images;
            this.cd.detectChanges();
        });

        this.router.queryParams.subscribe((queryParams) => {
            this.token = queryParams['token'];

            if (this.token) {
                this.onLoginSSO(this.token);
            }
        });
    }

    getImages() {
        return lastValueFrom(this.http.get<any>('assets/demo/data/photos.json'))
            .then((res) => <any[]>res.data)
            .then((data) => {
                return data;
            });
    }

    onLogin() {
        if (this.formControl.valid) {
            this.isLoading = true;
            const loginForm = this.formControl.getRawValue();
            loginForm.password = encryptionPassword(loginForm.password);
            this.srv.postLogin('auth/loginV2', loginForm).subscribe({
                next: (resp) => {
                    this.auth.createSession(resp);
                    this.isLoading = false;
                    this.route.navigate(['/']);
                },
                error: (err) => {
                    this.isLoading = false;
                },
            });
        } else {
            this.formControl.markAllAsTouched();
        }
    }

    onLoginSSO(code) {
        this.isLoading = true;
        this.srv.get('open/auth/detail/' + code).subscribe({
            next: (resp) => {
                let data = JSON.stringify(resp);
                this.auth.createSession(data);
                this.isLoading = false;
                this.route.navigate(['/']);
            },
            error: (err) => {
                this.isLoading = false;
            },
        });
    }
}

