import { HelperService } from 'src/app/core/service/helper-service';
import { ConfigService } from 'src/app/core/service/app.config.service';
import { DashboardService } from '../../service/dashboard.service';

@Component({
    selector: 'app-payroll-monthly-dashboard',
    templateUrl: './payroll-monthly-dashboard.component.html',
    styleUrls: ['./payroll-monthly-dashboard.component.scss'],
})
export class PayrollMonthlyDashboardComponent implements OnInit, OnDestroy {
    chartOptions;
    loading = true;

    constructor(
        private srv: DashboardService,
        private configService: ConfigService,
        private help: HelperService
    ) {
        this.chartOptions = {
            chart: {
                id: 'Payroll-chart',
                height: 350,
                type: 'line',
                toolbar: {
                    show: true,
                },
                zoom: {
                    enabled: false,
                },
            },
            plotOptions: {
                bar: {
                    columnWidth: '45%',
                    distributed: false,
                },
            },
            yaxis: {
                title: {
                    text: 'Gaji',
                },
                labels: {
                    formatter: function (value) {
                        let val: string | number = Math.abs(value);

                        if (val >= 10 ** 3 && val < 10 ** 6) {
                            val = (val / 1000).toFixed(0) + ' K';
                        } else if (val >= 10 ** 6) {
                            val = (val / 1000000).toFixed(0) + ' JT';
                        } else {
                            val = val;
                        }

                        return val;
                    },
                },
            },
            colors: [
                '#14B8A6',
                '#008FFB',
                '#FEB019',
                '#FF4560',
                '#775DD0',
                '#546E7A',
                '#26a69a',
                '#D10CE8',
            ],
            series: [
                {
                    name: 'Penggajian',
                    data: [],
                },
            ],
            labelName: [],
            dataLabels: {
                enabled: false,
            },
            grid: {
                borderColor: '#e7e7e7',
                row: {
                    colors: ['#f3f3f3', 'transparent'],
                    opacity: 0.5,
                },
            },
            xaxis: {
                categories: [],
                tickPlacement: 'on',
                title: {
                    text: 'Bulan',
                },
            },
            responsive: [
                {
                    breakpoint: 900,
                    options: {
                        chart: {
                            height: 400,
                        },
                    },
                },
            ],
        };
    }

    subcription;
    ngOnInit(): void {
        this.getData();
        this.subcription = this.configService.menuToggle$.subscribe(
            (config) => {
                this.wait();
            }
        );
    }

    async wait() {
        await new Promise((f) => setTimeout(f, 200));
        this.reload();
    }

    getData() {
        this.loading = true;
        this.srv
            .getPayrollMonthly()
            .toPromise()
            .then((res) => {
                this.chartOptions.series[0].data = res.data;
                this.chartOptions.labelName = res.label;
                this.loading = false;
                this.reload();
            });
    }

    reload() {
        this.chartOptions.responsive = [
            {
                breakpoint: 480,
                options: {
                    chart: {
                        height: 350,
                    },
                },
            },
        ];
        var chart = new ApexCharts(
            document.querySelector('#PayrollMonthlyChart'),
            this.chartOptions
        );
        chart.render();
    }
    ngOnDestroy(): void {
        this.subcription.unsubscribe();
    }
}

