                birthDate: [{ value: '', disabled: true }],
                gender: [{ value: '', disabled: true }],
                numberId: [{ value: '', disabled: true }],
                email: [{ value: '', disabled: true }],
                religion: [{ value: '', disabled: true }],
            }),
        });
        this.bankForm = this.formBuilder.group({
            bankName: ['', Validators.required],
            accountName: ['', Validators.required],
            accountNumber: ['', Validators.required],
            company: {
                id: this.companyId,
            },
        });
        this.form = this.formBuilder.group({
            date: ['', Validators.required],
            companySubscription: [
                {
                    id: ['', Validators.required],
                },
            ],
            compId: [[this.companyId]],
        });
    }
    onAdd() {
        this.isShow = true;
    }
    onDelete() {
        this.srv.deleteBank(this.selected).subscribe((res) => {
            this.messageBoxService.showSuccess(res);
            this.getDetail(this.companyId);
            this.selected = [];
        });
    }
    click(e) {
        if (e == 'edit') {
            this.onEdit();
        } else if (e == 'extend') {
            this.isShowExtend = true;
            this.form.get('date').reset();
        } else if (e == 'terminate') {
            this.isShowTermit = true;
            this.form.get('date').reset();
        } else if (e == 'add') {
            this.onAdd();
        } else if (e == 'delete') {
            this.onDelete();
        }
    }
    onEdit() {
        this.router.navigate(['/util/company/edit/' + this.companyId]);
    }

    selectCompSubs(e) {
        this.form.get('companySubscription').patchValue({ id: e.id });
    }

    onSave() {
        if (this.bankForm.valid) {
            this.srv.saveBank(this.bankForm.getRawValue()).subscribe((res) => {
                this.messageBoxService.showSuccess(res);
                this.isShow = false;
                this.getDetail(this.companyId);
            });
        } else {
            this.bankForm.markAllAsTouched();
        }
    }
    onSaveExtend() {
        if (this.form.valid) {
            const data = this.form.getRawValue();
            data.date = this.help.formatDate(data.date);

            this.srv.extend(data).subscribe((res) => {
                this.messageBoxService.showSuccess(res);
                this.isShowExtend = false;
                this.getDetail(this.companyId);
            });
        } else {
            this.form.markAllAsTouched();
        }
    }
    onSaveTermit() {
        if (this.form.valid) {
            const data = this.form.getRawValue();
            data.date = this.help.formatDate(data.date);
            data.companySubscription = null;

            this.srv.terminate(data).subscribe((res) => {
                this.messageBoxService.showSuccess(res);
                this.isShowTermit = false;
                this.getDetail(this.companyId);
            });
        } else {
            this.form.markAllAsTouched();
        }
    }

    handleChange(e) {
        if (e.checked) {
            this.formGroup.get('companyTaxNumber').enable();
        } else {
            this.formGroup.get('companyTaxNumber').disable();
            this.formGroup.get('companyTaxNumber').reset();
        }
    }
}

import { Component, OnInit } from '@angular/core';
import { UntypedFormGroup, UntypedFormBuilder, Validators } from '@angular/forms';
import { ActivatedRoute, Router } from '@angular/router';
import { AuthenticationService } from 'src/app/core/service/authentication.service';
import { HelperService } from 'src/app/core/service/helper-service';
import { MessageBoxService } from 'src/app/core/service/message-box.service';
import { UtilCompanyService } from '../service/util-company.service';

@Component({
    selector: 'app-util-company-edit',
    templateUrl: './util-company-edit.component.html',
    styleUrls: ['./util-company-edit.component.scss'],
})
export class UtilCompanyEditComponent implements OnInit {
    loading = true;
    formGroup: UntypedFormGroup;
    companyId;
    imgSrc;
    selected = [];
    isShow = false;
    bankForm: UntypedFormGroup;
    uploadedFiles;
    isNpwp;

    constructor(
        private formBuilder: UntypedFormBuilder,
        private srv: UtilCompanyService,
        private messageBoxService: MessageBoxService,
        private auth: AuthenticationService,
        private route: ActivatedRoute,
        private help: HelperService,
        private router: Router
    ) {}

    ngOnInit(): void {
        this.companyId = this.route.snapshot.paramMap.get('id');
        this.createForm();
        this.getDetail(this.companyId);
    }
    getDetail(id) {
        this.loading = true;
        this.srv.getOne(id).subscribe(
            (res) => {
                res.effBegin = res.effBegin ? new Date(res.effBegin) : null;
                res.effEnd = res.effEnd ? new Date(res.effEnd) : null;
                if (res.owner) {
                    res.owner.birthDate = res.owner.birthDate
                        ? new Date(res.owner.birthDate)
                        : null;
                }

                if (res.companyTaxNumber === null) {
                    this.isNpwp = false;
                } else {
                    this.isNpwp = true;
                }
                this.formGroup.patchValue(res);

                this.imgSrc =
                    'data:image/' +
                    res.fileLogo.ext +
                    ';base64,' +
                    res.fileLogo.base;
                this.loading = false;
            },
            (err) => {
                this.loading = false;
            }
        );
    }

    createForm(): void {
        this.formGroup = this.formBuilder.group({
            id: [''],
            version: [''],
            code: [{ value: '', disabled: true }],
            name: [{ value: '', disabled: true }],
            address: [''],
            effBegin: [{ value: '', disabled: true }],
            effEnd: [{ value: '', disabled: true }],
            phone: [''],
            fax: [''],
            email: ['', [Validators.email,Validators.required]],
            scale: ['',Validators.required],
            companyType: [''],
            companyTaxNumber: [null],
        });
    }
    onUpdate() {
        if (this.formGroup.valid) {
            const formData: FormData = new FormData();

            if (this.uploadedFiles) {
                formData.append('logo', this.uploadedFiles);
            }
            formData.append(
                'company',
                JSON.stringify(
                    this.help.formatDate(this.formGroup.getRawValue())
                )
            );
            this.srv.update(formData).subscribe((res) => {
                this.messageBoxService.showSuccess(res);
                this.router.navigate(['util/company']);
            });
        } else {
            this.formGroup.markAllAsTouched();
        }
    }
    selectCT(e) {
        this.formGroup.patchValue({
            companyType: {
                id: e.id,
            },
        });
    }
    onFileChange(e) {
        this.uploadedFiles = e;
    }

    selectScale(e) {
        this.formGroup.patchValue({
            scale: e.value,
        });
    }
}

import {
    ChangeDetectionStrategy,
    ChangeDetectorRef,
    Component,
    OnInit,
} from '@angular/core';
import { UntypedFormBuilder, UntypedFormGroup, Validators } from '@angular/forms';
import { Router } from '@angular/router';
import { PageInfo } from 'src/app/core/model/page-info';
import { HelperService } from 'src/app/core/service/helper-service';
import { MessageBoxService } from 'src/app/core/service/message-box.service';
import { UtilCompanyService } from '../service/util-company.service';

@Component({
    selector: 'app-util-company-list',
    templateUrl: './util-company-list.component.html',
    styleUrls: ['./util-company-list.component.scss'],
    changeDetection: ChangeDetectionStrategy.OnPush,
})
export class UtilCompanyListComponent implements OnInit {
    list = [];
    listFilter = [
        { label: 'Semua', value: '' },
        { label: 'Aktif', value: 'Active' },
        { label: 'Non Aktif', value: 'Stop' },
    ];
    isShowExtend = false;
    isShowTermit = false;
    count = 0;
    first = 0;
    form: UntypedFormGroup;
    constructor(
        private router: Router,
        private srv: UtilCompanyService,
        private cd: ChangeDetectorRef,
        private msg: MessageBoxService,
        private formBuilder: UntypedFormBuilder,
        private help: HelperService
    ) {}
    loading = false;
    selected = [];
    body;
    ngOnInit(): void {
        this.form = this.formBuilder.group({
            date: ['', Validators.required],
            companySubscription: [
                {
                    id: ['', Validators.required],
                },
            ],
        });
    }

    onSearch(e) {
        this.body = e;
        this.getList(new PageInfo(1, 10));
    }

    onTableLazyLoad(e) {
        const page = e.first / e.rows + 1;
        const limit = e.rows;
        this.getList(new PageInfo(page, limit));
    }

    getList(pi) {
        this.first = pi.page - 1;
        this.loading = true;
        this.list = [];
        this.srv.getAll(pi, this.body).subscribe(
            (res) => {
                if (res) {
                    this.loading = false;
                    this.list = res.data;
                    this.count = res.count;
                    this.cd.detectChanges();
                }
            },
            (err) => {
                this.loading = false;
                this.cd.detectChanges();
            }
        );
    }

    selectCompSubs(e) {
        this.form.get('companySubscription').patchValue({ id: e.id });
    }

    onModal() {
        this.isShowExtend = true;
    }

    onAdd() {
        this.router.navigate(['/util/company/add']);
    }

    aksi(e) {
        if (e == 'add') {
            this.onAdd();
        } else if (e == 'extend') {
            this.isShowExtend = true;
            this.form.reset();
        } else if (e == 'terminate') {
            this.isShowTermit = true;
            this.form.reset();
        }
    }
    onEdit(e) {
        this.router.navigate(['/util/company/' + e.id]);
    }

    onSave(isExtend) {
        if (this.form.valid) {
            let idList = [];
            this.selected.forEach((e) => {
                idList.push(e.id);
            });
            let body = this.form.getRawValue();
            body.compId = idList;
            if (isExtend) {
                this.onSaveExtend(this.help.formatDate(body));
            } else {
                this.onSaveTermit(this.help.formatDate(body));
            }
        } else {
            this.form.markAllAsTouched();
        }
    }

    onSaveExtend(e) {
        this.srv.extend(e).subscribe((res) => {
            this.selected = [];
            this.msg.showSuccess(res);
            this.isShowExtend = false;
            this.getList(new PageInfo(1, 10));
            this.isShowExtend = false;
            this.cd.detectChanges();
        });
    }

    onSaveTermit(e) {
        this.srv.terminate(e).subscribe((res) => {
            this.selected = [];
            this.msg.showSuccess(res);
            this.isShowTermit = false;
            this.getList(new PageInfo(1, 10));
            this.isShowTermit = false;
            this.cd.detectChanges();
        });
    }
}

